import './App.css';
import Body from './components/body/Body';
import Navbar from './components/navbar/Navbar';
import TokenState from './context/Token/TokenState';
import GitData from './route/GitData';


function App() {
  return (
    <div className="App">
    <TokenState>
    <Navbar/>
    <Body/>
    <Route path="GitData" element={<GitData />} />
    </TokenState>
    </div>
  );
}

export default App;
